import {Container, HeaderChess} from '../style/style'
import Image from 'next/image'


function Home () {
    return (
        <Container>
            <HeaderChess src="/chess.png">
                <Image responsive="true" width="1000" height="500"  src="/chess.png"/>
            </HeaderChess>
        </Container>
    )
}

export default Home
